// pages/Perfil.js
import React from 'react';

function Perfil() {
  return (
    <div>
      <h1>Nome</h1>
      <img src="user.jpg" alt="User" width="100" height="500"></img>
      <p>Aqui estão as informações o user.</p>
    </div>
  );
}

export default Perfil;
